import React, { useState, useEffect } from 'react';
import SubmissionList from './SubmissionList'; // Import the SubmissionList component

function App() {
  // State for submissions
  const [submissions, setSubmissions] = useState([]);

  // Dummy submission data (you can replace this with actual data from your database)
  const dummySubmission = {
    name: 'John Doe',
    email: 'johndoe@example.com',
    dateOfBirth: '1990-01-01',
    subjectArea: 'Engineering',
    location: 'Cardiff, Wales'
  };

  useEffect(() => {
    // Set the submissions state with the dummy submission
    setSubmissions([dummySubmission]);
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        {/* Remove the default logo and text */}
        <h1>Submissions</h1>
        <SubmissionList submissions={submissions} /> {/* Render the SubmissionList component */}
      </header>
    </div>
  );
}

export default App;
